{
  "hooks": {
    "pre-commit": "pnpm format:fix && pnpm lint && pnpm build && pnpm test",
    "commit-msg": "commitlint -E HUSKY_GIT_PARAMS"
  }
}

{
  "$schema": "https://biomejs.dev/schemas/1.8.2/schema.json",
  "files": {
    "ignore": [
      "node_modules",
      "packages/*/dist",
      "examples/aws/.build",
      "examples/firebase-functions/lib",
      "coverage",
      ".pnpm-store"
    ]
  },
  "formatter": {
    "enabled": true,
    "formatWithErrors": false,
    "indentStyle": "space",
    "indentWidth": 2,
    "lineEnding": "lf",
    "lineWidth": 120,
    "attributePosition": "auto"
  },
  "organizeImports": {
    "enabled": true
  },
  "linter": {
    "enabled": true,
    "rules": {
      "recommended": true,
      "correctness": {
        "noVoidTypeReturn": "off"
      },
      "style": {
        "noParameterAssign": "off",
        "noNonNullAssertion": "off"
      },
      "suspicious": {
        "noAssignInExpressions": "off",
        "noExplicitAny": "off"
      }
    }
  },
  "javascript": {
    "formatter": {
      "jsxQuoteStyle": "double",
      "quoteProperties": "asNeeded",
      "trailingCommas": "none",
      "semicolons": "asNeeded",
      "arrowParentheses": "always",
      "bracketSpacing": true,
      "bracketSameLine": false,
      "quoteStyle": "single",
      "attributePosition": "auto"
    }
  }
}

import commitlint from '@commitlint/config-conventional'

export default {
  extends: ['@commitlint/config-conventional'],
  ...commitlint.rules,
  'type-enum': [
    2,
    'always',
    ['fix', 'test', 'tooling', 'refactor', 'revert', 'example', 'docs', 'format', 'feat', 'chore', 'ci']
  ]
}

